// mockapi.js
import axios from 'axios';

// New base URL for the 2-hour Weather Forecast API
const BASE_URL = 'https://api-open.data.gov.sg/v2/real-time/api';
const mockAPI = axios.create({ baseURL: BASE_URL });

export default mockAPI;
